import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import renderPokemon from './PokemonRendering';

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

ReactDOM.render(
  renderPokemon(),
  document.getElementById('root')
);
